import React from 'react';

const Help = () => (
  <div className="help">
    <h2>How to Play</h2>
    <p>
      Guess the hidden word by selecting letters. Each incorrect guess brings
      the hangman closer to hanging. You lose when the hangman is dead,
      but you win if you guess the word first!...Goodluck most words have some vowels in them
    </p>
  </div>
);

export default Help;
